import React, { useEffect, useState } from 'react';
import { useNavigate, useSearchParams } from 'react-router-dom';
import {
  List,
  ListItem,
  ListItemText,
  ListItemButton,
  Typography,
  Paper,
  CircularProgress,
  Box,
  Alert,
  Chip,
  Divider
} from '@mui/material';
import { api, FIELDS } from '../config/quickbase.ts';

interface QuickBaseField {
  value: string | boolean;
}

interface Question {
  [key: number]: QuickBaseField;
}

interface Answer {
  [key: number]: QuickBaseField;
}

const QuestionList = () => {
  const [searchParams] = useSearchParams();
  const userId = searchParams.get('userId');
  const requestId = searchParams.get('requestId');
  const formId = searchParams.get('formId');
  const [questions, setQuestions] = useState<Question[]>([]);
  const [answers, setAnswers] = useState<Record<string, Answer>>({});
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      if (!userId || !requestId || !formId) {
        setError('Missing required parameters: userId, requestId, or formId');
        setLoading(false);
        return;
      }

      try {
        // Fetch questions
        const questionsResponse = await api.getQuestions(formId);
        setQuestions(questionsResponse.data);

        // Fetch answers for all questions
        const answersMap: Record<string, Answer> = {};
        for (const question of questionsResponse.data) {
          const questionId = String(question[FIELDS.QUESTIONS.RECORD_ID].value);
          try {
            const answerResponse = await api.getAnswer(questionId, requestId);
            if (answerResponse.data && answerResponse.data.length > 0) {
              answersMap[questionId] = answerResponse.data[0];
            }
          } catch (error) {
            console.error(`Error fetching answer for question ${questionId}:`, error);
            // Continue with other questions even if one fails
          }
        }
        setAnswers(answersMap);
      } catch (error) {
        setError('Failed to fetch data');
        console.error('Error fetching data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [userId, requestId, formId]);

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="200px">
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Alert severity="error" sx={{ mb: 2 }}>
        {error}
      </Alert>
    );
  }

  return (
    <Paper elevation={3} sx={{ p: 2 }}>
      <Typography variant="h5" gutterBottom>
        Questions
      </Typography>
      <List>
        {questions.map((question) => {
          const questionId = String(question[FIELDS.QUESTIONS.RECORD_ID].value);
          const hasAnswer = answers[questionId] !== undefined;
          const isRequired = question[FIELDS.QUESTIONS.REQUIRED].value as boolean;
          const answer = answers[questionId];
          const userEmail = answer?.[FIELDS.ANSWERS.USER_EMAIL]?.value;

          return (
            <React.Fragment key={questionId}>
              <ListItem disablePadding>
                <ListItemButton
                  onClick={() => navigate(`/question/${questionId}?userId=${userId}&requestId=${requestId}&formId=${formId}`)}
                >
                  <ListItemText
                    primary={
                      <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                        <Typography variant="body1">
                          {String(question[FIELDS.QUESTIONS.QUESTION].value)}
                        </Typography>
                        {isRequired && (
                          <Typography color="error" component="span">*</Typography>
                        )}
                      </Box>
                    }
                    secondary={
                      hasAnswer && (
                        <Box sx={{ mt: 1 }}>
                          <Typography variant="body2" color="text.secondary">
                          {String(userEmail)}: {String(answer[FIELDS.ANSWERS.ANSWER].value)}
                          </Typography>
                          {userEmail && (
                            <Typography variant="caption" color="text.secondary">
                              Answered by: {String(userEmail)}
                            </Typography>
                          )}
                        </Box>
                      )
                    }
                  />
                </ListItemButton>
              </ListItem>
              <Divider />
            </React.Fragment>
          );
        })}
      </List>
    </Paper>
  );
};

export default QuestionList;
